import React, {Component} from 'react';
import CountryCard from './CountryCard';

const Countries = ({country}) => {
		return ( 
			<div>
			 { country.map((each, i) => {
			 	console.log(i, each);
			 	return (<CountryCard key={i} name={country[i].name.common} capital={country[i].capital[0]} continent={country[i].continents[0]} subregion={country[i].subregion} map={country[i].maps.googleMaps} unMember={country[i].unMember} population={country[i].population} flag={country[i].flags.png} />)
			 })
			}
			</div>
		)
}

export default Countries;
